// src/App.js
import React, { useState } from "react";
import { BrowserRouter as Router, Route, Routes } from "react-router-dom";
import Navbar from "./components/Navbar.js";
import Home from "./components/Home.js";
import About from "./components/About.js";
import Mission from "./components/Mission.js";
import Approach from "./components/Approach.js";
import Footer from "./components/Footer.js";
import LanguageContext from "./LanguageContext";
import "./App.css";

function App() {
  const [isEnglish, setIsEnglish] = useState(true);

  const toggleLanguage = () => {
    setIsEnglish((prev) => !prev);
  };

  return (
    <LanguageContext.Provider value={{ isEnglish, toggleLanguage }}>
      <Router>
        <Routes>
          <Route
            path="/"
            element={
              <div>
                <Navbar />
                <div style={{ marginBottom: "20px" }} id="home">
                  <Home />
                </div>
                <div style={{ marginBottom: "20px" }} id="about">
                  <About />
                </div>
                <div style={{ marginBottom: "20px" }} id="mission">
                  <Mission />
                </div>
                <div style={{ marginBottom: "20px" }} id="approach">
                  <Approach />
                </div>
                <Footer />
              </div>
            }
          />
        </Routes>
      </Router>
    </LanguageContext.Provider>
  );
}

export default App;
